', 'kesadaran compos gcs 15 ews P (0) akral hangat nadi teraba kuat, pasien nampak sesak dan lebih nyaman dengan posisi setengah duduk. TD: 111/74 mmhg N: 66 x/mnt S: 36.4 C R: 20 x/mnt Spo2: 96 ngan RA, terpasang IVFD Venflon, DC 5/6/25. Pemeriksaan Thorax Dewasa Pa/Ap 5/6/25 Lab 5/6/25Troponin T 45. PKM HB 16.2 HT 48 ERIT 5.3 LEU 12000 TROMBO 266 GDS 98 GDS 98 KOLESTEROL 203 CR 0.65 UR 145 EKG', 'Penurunan curah jantung, intoleransi aktivitas', 'setelah dilakukan asuhan keperawatan selama 3x24 jam di harapkan curah jantung meningkat kekuatan nadi perifer meningkat, , cardiac index (CI) meningkat, lelah menurun, setelah dilakukan tindakan asuhan keperawatan selama 3 x 24 jam diharapkan Toleransi Aktivitas Meningkat dengan kriteria hasil Kemudahan dalam melakukan aktivitas sehari-hari meningkat ,Keluhan lelah menurun,Dispnea saat beraktivitas menurun', '', '', '', '', '', '', '', '', '1848', '1', '<p>UMU/hari</p><p>PP SORE<div>Identifikasi tanda dan gejala primer penurunan curah jantung Identifikasi tanda dan gejala sekunder penurunan curah jantung,Monitor intake dan output cairan,monitor saturasi oksigen,Posisikan pasien semi-fowler atau fowler dengan kaki kebawah atau posisi nyaman, Berikan diet jantung yang sesuai), Ajarkan pasien dan keluarga ,mengukur intake output cairan harian,Anjurkan beraktivitas fisik sesuai toleransi,Anjurkan beraktivitas fisik secara bertahap</div><div>Identifikasi gangguan fungsi tubuh yang mengakibatkan kelelahan,Monitor kelelahan fisik dan emosional.Monitor pola dan jam tidur,Monitor lokasi dan ketidaknyamanan selama melakukan aktivitas, Sediakan lingkungan nyaman dan rendah stimulus,Lakukan latihan rentang gerak pasif dan atau akti,Berikan aktivitas distraksi yang menenangkan,Fasilitasi duduk di sisi tempat tidur, jika tidak dapat berpindah atau berjalan Anjurkan tirah baring,Anjurkan melakukan aktivitas secara bertahap,Anjurkan menghubungi perawat jika tanda dan gejala kelelahan tidak berkurang</div><div>PP malam</div><div>Identifikasi tanda dan gejala primer penurunan curah jantung Identifikasi tanda dan gejala sekunder penurunan curah jantung,Monitor intake dan output cairan,monitor saturasi oksigen,Posisikan pasien semi-fowler atau fowler dengan kaki kebawah atau posisi nyaman, Berikan diet jantung yang sesuai), Ajarkan pasien dan keluarga ,mengukur intake output cairan harian,Anjurkan beraktivitas fisik sesuai toleransi,Anjurkan beraktivitas fisik secara bertahap</div><div>Identifikasi gangguan fungsi tubuh yang mengakibatkan kelelahan,Monitor kelelahan fisik dan emosional.Monitor pola dan jam tidur,Monitor lokasi dan ketidaknyamanan selama melakukan aktivitas, Sediakan lingkungan nyaman dan rendah stimulus,Lakukan latihan rentang gerak pasif dan atau akti,Berikan aktivitas distraksi yang menenangkan,Fasilitasi duduk di sisi tempat tidur, jika tidak dapat berpindah atau berjalan Anjurkan tirah baring,Anjurkan melakukan aktivitas secara bertahap,Anjurkan menghubungi perawat jika tanda dan gejala kelelahan tidak berkurang</div></p>', NULL, '1848', 0, NULL, '2025-06-07 12:40:11')
